import React from 'react';

const TestCard = ({it}) => {
    return (
        <div className="col-3 ">
            <p>{it.question}</p>
            {it?.answers?.map( it => {
                return <div>{it}</div>
                }
                
            )

            }
        </div>
    );
};

export default TestCard;
